// Paramter Signature
export interface IParamSignatureList {
  id? : string;
  signerId? : string;
  sequence? : number;
  action?: string;
}

export class ParamSignatureList implements IParamSignatureList {
  constructor(
    public id? : string,
    public signerId? : string,
    public sequence? : number,
    public action?: string
  ) {}
}

export interface IParamSignature {
  id? : string;
  signatureList? : IParamSignatureList[];
  signatureReqList? : IParamSignatureList[];
  status?: string;
  statusBy?: string;
  statusDt?: Date;
}

export class ParamSignature implements IParamSignature {
  constructor(
    public id? : string,
    public signatureList? : IParamSignatureList[],
    public signatureReqList? : IParamSignatureList[],
    public status? : string,
    public statusBy? : string,
    public statusDt?: Date
  ) {}
}

// Parameter User
export interface IParamUserList {
  id? : string;
  code? : string;
  name? : string;
  value? : string
  type? : string;
  action?: string;
}

export class ParamUserList implements IParamUserList {
  constructor(
    public id? : string,
    public code? : string,
    public name? : string,
    public value? : string,
    public type? : string,
    public action? : string
  ) {}
}

export interface IParamUser {
  id? : string;
  paramList? : IParamUserList[];
  paramReqList? : IParamUserList[];
  status?: string;
  statusBy?: string;
  statusDt?: Date;
}

export class ParamUser implements IParamUser {
  constructor(
    public id? : string,
    public paramList? : IParamUserList[],
    public paramReqList? : IParamUserList[],
    public status? : string,
    public statusBy? : string,
    public statusDt?: Date
  ) {}
}

// Parameter Limit
export interface IParamLimitAppr {
 id? : string;
 approverId? : string;
 sequence?: number;
 action?: string;
}

export class ParamLimitAppr implements IParamLimitAppr {
  constructor(
    public id? : string,
    public approverId? : string,
    public sequence?: number,
    public action?: string
  ) {}
}

export interface IParamLimitLevel {
 id? : string;
 level?: number,
 designation? : string,
 officialCap?: number;
 workingCap?: number;
 action? : string;
 limitLevelAppr? : IParamLimitAppr[];
 limitReqLevelAppr? : IParamLimitAppr[];
 limitLevelApprOpt? : any[];
 limitReqLevelApprOpt? : any[];
 isModified?: boolean;
}

export class ParamLimitLevel implements IParamLimitLevel {
  constructor(
    public id? : string,
    public level? : number,
    public designation? : string,
    public officialCap?: number,
    public workingCap?: number,
    public action?: string,
    public limitLevelAppr? : IParamLimitAppr[],
    public limitReqLevelAppr? : IParamLimitAppr[],
    public limitLevelApprOpt? : any[],
    public limitReqLevelApprOpt? : any[],
    public isModified? : boolean
  ) {}
}

export interface IParamLimit {
  id? : string;
  limitLevels? : IParamLimitLevel[];
  limitReqLevels? : IParamLimitLevel[];
  status?: string;
  statusBy?: string;
  statusDt?: Date;
}

export class ParamLimit implements IParamLimit {
  constructor(
    public id? : string,
    public limitLevels? : IParamLimitLevel[],
    public limitReqLevels? : IParamLimitLevel[],
    public status? : string,
    public statusBy? : string,
    public statusDt?: Date
  ) {}
}

// Parameter
export interface IParameter {
  overallStatus? : string;
  paramLimit? : IParamLimit;
  paramUser? : IParamUser;
  paramSignature? : IParamSignature;
}

export class Parameter implements IParameter {
  constructor(public overallStatus?: string,
    public paramLimit?: IParamLimit,
    public paramUser?: IParamUser,
    public paramSignature?: IParamSignature
  ) {}
}
